import * as React from "react";
import { AppContextConsumer } from "./AppContext";

export const PostInfo = () => (
  <AppContextConsumer>
    {appContext =>
      appContext && (
        <div>
          Name: {appContext.name}, Author: {appContext.author}, Url:{" "}
          {appContext.url}
        </div>
      )
    }
  </AppContextConsumer>
);

